// syntax/web/php.js
// HighlightJs: v.9.13.1

hljs.registerLanguage('php',
function(hljs) {
	var VARIABLE = {
		//begin: '\\$+[a-zA-Z_\x7f-\xff][a-zA-Z0-9_\x7f-\xff]*' // Fix By Unixman
		begin: '\\$+[a-zA-Z_]+[a-zA-Z0-9_]*'
	};
	var PREPROCESSOR = {
		className: 'meta', begin: /<\?(php)?|\?>/
	};
	var STRING = {
		className: 'string',
		contains: [hljs.BACKSLASH_ESCAPE, PREPROCESSOR],
		variants: [
			{
				begin: 'b"', end: '"'
			},
			{
				begin: 'b\'', end: '\''
			},
			hljs.inherit(hljs.APOS_STRING_MODE, {illegal: null}),
			hljs.inherit(hljs.QUOTE_STRING_MODE, {illegal: null})
		]
	};
	var NUMBER = {variants: [hljs.BINARY_NUMBER_MODE, hljs.C_NUMBER_MODE]};
	return {
		aliases: ['php', 'php3', 'php4', 'php5', 'php6', 'php7'],
		case_insensitive: true,
		keywords:
			'and include_once list abstract global private echo interface as static endswitch ' +
			'array null if endwhile or const for endforeach self var while isset public ' +
			'protected exit foreach throw elseif include __FILE__ empty require_once do xor ' +
			'return parent clone use __CLASS__ __LINE__ else break print eval new ' +
			'catch __METHOD__ case exception default die require __FUNCTION__ ' +
			'enddeclare final try switch continue endfor endif declare unset true false bool int float string ' +
			'trait goto instanceof insteadof __DIR__ __NAMESPACE__ ' +
			'yield finally',
		contains: [
			hljs.HASH_COMMENT_MODE,
			hljs.COMMENT('//', '$', {contains: [PREPROCESSOR]}),
			hljs.COMMENT(
				'/\\*',
				'\\*/',
				{
					contains: [
						{
							className: 'doctag',
							begin: '@[A-Za-z]+'
						}
					]
				}
			),
			hljs.COMMENT(
				'__halt_compiler.+?;',
				false,
				{
					endsWithParent: true,
					keywords: '__halt_compiler',
					lexemes: hljs.UNDERSCORE_IDENT_RE
				}
			),
			{
				className: 'string',
				begin: /<<<['"]?\w+['"]?$/, end: /^\w+;?$/,
				contains: [
					hljs.BACKSLASH_ESCAPE,
					{
						className: 'subst',
						variants: [
							{begin: /\$\w+/},
							{begin: /\{\$/, end: /\}/}
						]
					}
				]
			},
			PREPROCESSOR,
			{
			//	className: 'keyword', begin: /\$this\b/ // Fix By Unixman
				className: 'variable', begin: /\$[a-zA-Z0-9_]+\b/
			},
			VARIABLE,
			{
				// swallow composed identifiers to avoid parsing them as keywords
				begin: /(::|->)+[a-zA-Z_\x7f-\xff][a-zA-Z0-9_\x7f-\xff]*/
			},
			{
				className: 'function',
				beginKeywords: 'function', end: /[;{]/, excludeEnd: true,
				illegal: '\\$|\\[|%',
				contains: [
					hljs.UNDERSCORE_TITLE_MODE,
					{
						className: 'params',
						begin: '\\(', end: '\\)',
						contains: [
							'self',
							VARIABLE,
							hljs.C_BLOCK_COMMENT_MODE,
							STRING,
							NUMBER
						]
					}
				]
			},
			{
				className: 'class',
				beginKeywords: 'class interface', end: '{', excludeEnd: true,
				illegal: /[:\(\$"]/,
				contains: [
					{beginKeywords: 'extends implements'},
					hljs.UNDERSCORE_TITLE_MODE
				]
			},
			{
				beginKeywords: 'namespace', end: ';',
				illegal: /[\.']/,
				contains: [hljs.UNDERSCORE_TITLE_MODE]
			},
			{
				beginKeywords: 'use', end: ';',
				contains: [hljs.UNDERSCORE_TITLE_MODE]
			},
			{
				begin: '=>' // No markup, just a relevance booster
			},
			STRING,
			NUMBER
		]
	};
}
);

